import React, {Component} from 'react';
import PropTypes from 'prop-types';

class RenderTables extends Component {
    render() {
        const data = this.props.tables;
        const allElements = data.map((d) => {
            <h4 className={'table1t1'} key={data.indexOf(d)}>
                This is a table.
                Capacity: {d.capacity};
                Length: {d.length};
                Width: {d.width}.
            </h4>
        });
        console.log(data);
        return (
            <div>
                {allElements}
            </div>
        );
    }
}

RenderTables.propTypes = {};

export default RenderTables;
